////////////////////////////////////////////////////////////////////////////////////////////////////
function arclab_InputUTF8($a)
{

if(mb_detect_encoding($a)!="UTF-8"||!mb_check_encoding($a,"UTF-8"))$a=utf8_encode($a); 
$a=str_replace("\r",'',$a);$a=str_replace("\n","\r\n",$a);
return $a;
}

function arclab_VarToHTML($a)
{
$a=htmlspecialchars($a,ENT_QUOTES,'UTF-8');
$a=str_replace("\r",'',$a);$a=str_replace("\n",'<br>',$a);
return $a;
}

function arclab_VarToXML($a)
{
$a=htmlspecialchars($a,ENT_XML1,'UTF-8');
$a=str_replace("\r",'',$a);$a=str_replace("\n","\r\n",$a);
return $a;
}

function arclab_VarToCSV($a)
{
$a=str_replace("\"","\"\"",$a);
$a=str_replace("\r",'',$a);$a=str_replace("\n","\r\n",$a);
return $a;
}

function arclab_Split($a)
{
return trim(chunk_split($a,76,"\r\n"))."\r\n";
}

function arclab_isEmail($a)
{
//return filter_var($a,FILTER_VALIDATE_EMAIL);
return (bool)preg_match('/^[^@,;:\x22\s<>\(\)\[\]]+@[^@,;:\s\x22\x27<>\(\)\[\]+!#$%&]+\.[^@,;:\s\x22\x27<>\(\)\[\]+!#$%&]+?$/',$a);
}

function arclab_isASCII($a)
{
//return mb_detect_encoding($a,'ASCII',true);
return !(bool)preg_match('/[\x80-\xFF]/',$a);
}

function arclab_EncodeEmailIDN($a)
{
$p=explode('@',$a);
if(function_exists('idn_to_ascii')&&defined('IDNA_DEFAULT')&&count($p)==2)
{
if(!arclab_isASCII($p[1])&&!empty($p[0])&&!empty($p[1]))
{
$b='';
if(defined('INTL_IDNA_VARIANT_UTS46'))$b=idn_to_ascii($p[1],IDNA_DEFAULT,INTL_IDNA_VARIANT_UTS46);else $b=idn_to_ascii($p[1]);
if($b!==false&&!empty($b)){$r=$p[0].'@'.$b;if(arclab_isEmail($r))$a=$r;}
}
}
return $a;
}

function arclab_FilterHeader($a)
{
$r=array('/(\n+)/i','/(\r+)/i','/(\t+)/i','/(%0A+)/i','/(%0D+)/i','/(%08+)/i','/(%09+)/i');
$b=preg_replace($r,'',$a);
return $b;
}

function arclab_EncodeHeader($a)
{
if (!arclab_isASCII($a))$a='=?UTF-8?B?'.base64_encode($a).'?=';
return $a;
}

function arclab_EncodeHeaderEmail($a,$b)
{
$a=arclab_FilterHeader($a);
$b=arclab_FilterHeader($b);
if(!arclab_isEmail($b))return '';
$e='';
if(!empty($a))$e="\"".arclab_EncodeHeader($a)."\" ";
$e.='<'.arclab_EncodeEmailIDN($b).'>';
return $e;
}

function arclab_isUploadValid($v,$e,$s,$n,$r)
{
$c=0;
if(!isset($_FILES[$v])){if($r)return false;else return true;}
foreach($_FILES[$v]['tmp_name'] as $i => $FTN)
{
if(!empty($_FILES[$v]['error'][$i]))return false;
if(empty($FTN)||!is_uploaded_file($FTN))return false;
$FN=$_FILES[$v]['name'][$i];
$FS=$_FILES[$v]['size'][$i];
if(!empty($e)){if(!preg_match('/(.*?)\.('.$e.')$/',strtolower($FN)))return false;}
if($FS>$s)return false;	
$c++;
}
if($c>$n)return false;
return true;
}

function arclab_EncodeFilename($a,$i)
{
if(arclab_isASCII($a)&&(strlen($i)+2+strlen($a)<=76))return $a;
return mb_encode_mimeheader($a,'UTF-8','B',"\r\n",strlen($i)+2);
}

function arclab_EncodeBody($a,$p)
{
if($p)return "Content-Transfer-Encoding: 8bit\r\n\r\n".str_replace("\r\n.","\r\n",$a);
return "Content-Transfer-Encoding: base64\r\n\r\n".arclab_Split(base64_encode($a));
}

function arclab_ConvertNumeric($s)
{
$ic=strpos($s,','); $ip=strpos($s,'.');
if($ic!==FALSE&&$ip!==FALSE)
{
if($ic>$ip)$s=str_replace(',','',$s);
if($ic<$ip){$s=str_replace('.','',$s);$s=str_replace(',','.',$s);}
}
else
{
if($ic!==FALSE)$s=str_replace(',','.',$s);
}
return floatval($s);
}

function arclab_DecPl($f,$n)
{
return number_format($f,$n,'.','');
}

function arclab_ConvertDateTime($year,$month,$day,$hour,$min,$sec)
{
if($year==0&&$month==0&&day==0&&$hour==0&&min==0&&$sec==0)return null;
return sprintf('%04d-%02d-%02d %02d:%02d:%02d',(int)$year,(int)$month,(int)$day,(int)$hour,(int)$min,(int)$sec);
}

function arclab_ConvertDate($year,$month,$day)
{
if($year==0&&$month==0&&day==0)return null;
return sprintf('%04d-%02d-%02d',(int)$year,(int)$month,(int)$day);
}

function arclab_ConvertTime($hour,$min,$sec)
{
if($hour==0&&min==0&&$sec==0)return null;
return sprintf('%02d:%02d:%02d',(int)$hour,(int)$min,(int)$sec);
}

function arclab_ConvertBoolean($s)
{
if(empty($s))return 0;
$s=strtoupper($s);
if($s=='TRUE'||$s=='YES'||$s=='Y'||$s=='ON'||$s=='WAHR'||$s=='JA'||$s=='J'||$s=='AN')return 1;
if($s=='FALSE'||$s=='NO'||$s=='N'||$s=='OFF'||$s=='FALSCH'||$s=='NEIN'||$s=='AUS')return 0;
if(s==0) return 0; else return 1;
}

function arclab_UUIDv4()
{
return sprintf('%04x%04x-%04x-%04x-%04x-%04x%04x%04x',mt_rand(0,0xffff),mt_rand(0,0xffff),mt_rand(0,0xffff),mt_rand(0,0x0fff)|0x4000,mt_rand(0,0x3fff)|0x8000,mt_rand(0,0xffff),mt_rand(0,0xffff),mt_rand(0,0xffff));
}

function arclab_NoCache()
{
header_remove('ETag');
header_remove('Pragma');
header_remove('Cache-Control');
header_remove('Last-Modified');
header_remove('Expires');
header('Expires: Thu, 1 Jan 1970 00:00:00 GMT');
header('Cache-Control: no-store, no-cache, must-revalidate, max-age=0');
header('Cache-Control: post-check=0, pre-check=0',false);
header('Pragma: no-cache');
}

function arclab_H2T($a)
{
$a=preg_replace('/<\s*/','<',$a);
$a=preg_replace('~<head[^>]*>(.*?)</\s*head\s*>~is','',$a);
$a=preg_replace('~<style[^>]*>(.*?)</\s*style\s*>~is','',$a);
$a=preg_replace('~<script[^>]*>(.*?)</\s*script\s*>~is','',$a);
$a=str_replace(array("\n","\r","\t"),'',$a);
$a=str_replace('&nbsp;',' ',$a);
$a=preg_replace('/<table/i',"\r\n<table",$a);
$a=preg_replace('/<div/i',"\r\n<div",$a);
$a=preg_replace('~</\s*(tr|th|div|p|li|h1|h2|h3|h4|h5|h6)\s*>~i',"\r\n",$a);
$a=preg_replace('~</\s*td\s*>\s*<td~i',' <td',$a);
$a=preg_replace('/<br/i',"\r\n<br",$a);
$a=trim(preg_replace('/<.*?>/s','',$a));
$a=html_entity_decode($a);
$a=preg_replace("/\r\n\r\n\s+/","\r\n\r\n",$a);
return $a."\r\n";
}

function arclab_GetURL($url)
{
if(function_exists('curl_exec'))
{
$c=curl_init();
curl_setopt($c,CURLOPT_URL,$url);
curl_setopt($c,CURLOPT_RETURNTRANSFER,1);
curl_setopt($c,CURLOPT_CONNECTTIMEOUT,10);
$ret=curl_exec($c);
curl_close($c);
return $ret;
}
else
{
return file_get_contents($url);
}
}

function arclab_iCalTime($a,$b)
{
if(strtotime($a)===false)$a='1970-1-1 12:00';
$dt=new DateTime($a,new DateTimeZone($b));
$dt->setTimezone(new DateTimeZone('UTC'));
return $dt->format("Ymd\THis\Z");
}

function arclab_iCalStr($a)
{
if(strtotime($a)===false)$a='1970-1-1 '.$a;
if(strtotime($a)===false)$a='1970-1-1 12:00';
$dt=new DateTime($a,new DateTimeZone('UTC'));
return $dt;
}

function arclab_iCalLine($a)
{
$a=str_replace(",","\\,",$a);
$a=str_replace(";","\\;",$a);
$a=str_replace("\r","",$a);
$a=str_replace("\n","\\n",$a);
return trim(chunk_split($a,75,"\r\n "));
}

function arclab_SMTPC($t,$s,$p,$to)
{
$s=base64_decode($s);
if($t==2)$s="ssl://$s";else $s="tcp://$s";
if($t==2&&function_exists('stream_socket_client'))
{
$c=stream_context_create(array('ssl'=>array('verify_peer'=>false,'verify_peer_name'=>false)));
$smtp=stream_socket_client($s.':'.$p,$en,$es,$to,STREAM_CLIENT_CONNECT,$c);
}
else $smtp=fsockopen($s,$p,$en,$es,$to);
if(!$smtp)return false;
if(arclab_SMTPR($smtp,'220',$to))return $smtp;else return false;
}

function arclab_SMTPR($smtp,$r,$to)
{
stream_set_timeout($smtp,$to);
$a=fread($smtp,768);
$m=stream_get_meta_data($smtp);
if($m['timed_out']===true)return false;
return (substr($a,0,3)===$r);
}

